    return(
        <form className={`${styles.CadRecPasswordCliente}`}>
            <Inputs type={'text'} name={'nome'} placeholder={'Nome'}/>
            <Inputs type={'email'} name={'email'} placeholder={'Nome'}/>
            <Inputs type={'password'} name={'nome'} placeholder={'Nome'}/>
        </form>
        

    )
}

export default CadastroCliente
